function useMap(){
    const [wayPoints , setWayPoints] = useState(null);
    let [refMap , setRefMap] = useState(null);
    const saveMap = (map)=>{
        setRefMap(map)
    }

return [refMap, wayPoints, saveMap]
}

export default useMap;
